	if (_root.PauseGame == false && _root.playpause == false) {
		if (this.hitTest(_root.Course.Char.charClip.body) && _root.Course.Char.Water == true) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.035, 1.005);
			//_root.Course.Char.yspeed -= 0.2;
			_root.Course.Char.xspeed -= 0.4;
		}
	}
}

